22:5907:3272.docs:
Attempts to run this stream to completion, executing the provided asynchronous
closure for each element on the stream concurrently as elements become
available, exiting as soon as an error occurs.

This is similar to
[`StreamExt::for_each_concurrent`](crate::stream::StreamExt::for_each_concurrent),
but will resolve to an error immediately if the underlying stream or the provided
closure return an error.

This method is only available when the `std` or `alloc` feature of this
library is activated, and it is activated by default.

# Examples

```
# futures::executor::block_on(async {
use futures::channel::oneshot;
use futures::stream::{self, StreamExt, TryStreamExt};

let (tx1, rx1) = oneshot::channel();
let (tx2, rx2) = oneshot::channel();
let (_tx3, rx3) = oneshot::channel();

let stream = stream::iter(vec![rx1, rx2, rx3]);
let fut = stream.map(Ok).try_for_each_concurrent(
    /* limit */ 2,
    |rx| async move {
        let res: Result<(), oneshot::Canceled> = rx.await;
        res
    }
);

tx1.send(()).unwrap();
// Drop the second sender so that `rx2` resolves to `Canceled`.
drop(tx2);

// The final result is an error because the second future
// resulted in an error.
assert_eq!(Err(oneshot::Canceled), fut.await);
# })
```

2:8909:3094.docs:
Collects all the items from an iterator into a collection.

This method consumes the iterator and adds all its items to the
passed collection. The collection is then returned, so the call chain
can be continued.

This is useful when you already have a collection and wants to add
the iterator items to it.

This method is a convenience method to call [Extend::extend](trait.Extend.html),
but instead of being called on a collection, it's called on an iterator.

# Examples

Basic usage:

```
#![feature(iter_collect_into)]

let a = [1, 2, 3];
let mut vec: Vec::<i32> = vec![0, 1];

a.iter().map(|&x| x * 2).collect_into(&mut vec);
a.iter().map(|&x| x * 10).collect_into(&mut vec);

assert_eq!(vec![0, 1, 2, 4, 6, 10, 20, 30], vec);
```

`Vec` can have a manual set capacity to avoid reallocating it:

```
#![feature(iter_collect_into)]

let a = [1, 2, 3];
let mut vec: Vec::<i32> = Vec::with_capacity(6);

a.iter().map(|&x| x * 2).collect_into(&mut vec);
a.iter().map(|&x| x * 10).collect_into(&mut vec);

assert_eq!(6, vec.capacity());
println!("{:?}", vec);
```

The returned mutable reference can be used to continue the call chain:

```
#![feature(iter_collect_into)]

let a = [1, 2, 3];
let mut vec: Vec::<i32> = Vec::with_capacity(6);

let count = a.iter().collect_into(&mut vec).iter().count();

assert_eq!(count, vec.len());
println!("Vec len is {}", count);

let count = a.iter().collect_into(&mut vec).iter().count();

assert_eq!(count, vec.len());
println!("Vec len now is {}", count);
```

